import React from "react";
import {LoginForm} from "./LoginForm";
import {reduxForm} from "redux-form";

const LoginReduxForm = reduxForm({
    form: 'login'
})(LoginForm)

export const Login = (props) => {
    return (
        <>
            <h1>Login</h1>
            <LoginReduxForm />
        </>
    );
}
